import React from 'react'
import './style.css'
import logo from '../../assets/Logo.png'

const Background = () => {
    return (
        <>
            <nav className="Navbar">
                <div className="NavContainer">
                    <h1 className="NavHeader">Shortly</h1>
                </div>
            </nav>   
        </>
    )
}

export default Background;
